        weekdayRow.appendChild(wdDiv);\n                }\n                monthDiv.appendChild(weekdayRow);\n            \n                const daysGrid = document.createElement(\"div\");\n                daysGrid.style.display = \"grid\";\n                daysGrid.style.gridTemplateColumns = \"repeat(7, 24px)\";\n                daysGrid.style.justifyContent = \"center\";\n                daysGrid.style.gridAutoRows = \"24px\";\n                daysGrid.style.gap = \"3px\";\n                monthDiv.appendChild(daysGrid);\n            \n                const firstDay = new Date(monthYear, m, 1).getDay();\n                for (let empty = 0; empty &lt; firstDay; empty++) {\n                    const emptyDiv = document.createElement(\"div\");\n                    emptyDiv.style.width = \"24px\";\n                    emptyDiv.style.height = \"24px\";\n                    daysGrid.appendChild(emptyDiv);\n                }\n            \n                const numDays = getDaysInMonth(monthYear, m);\n                for (let d = 0; d &lt; numDays; d++) {\n                    const val = values[dayCounter];\n                    const date = new Date(monthYear, m, d + 1);\n            \n                    const dayDiv = document.createElement(\"div\");\n                    dayDiv.style.position = \"relative\";\n                    dayDiv.style.width = \"24px\";\n                    dayDiv.style.height = \"24px\";\n                    dayDiv.style.border = \"1px solid #ccc\";\n                    dayDiv.style.backgroundColor = getColor(val);\n                    dayDiv.style.color = \"#000\";\n                    dayDiv.style.fontSize = \"10px\";\n                    dayDiv.style.userSelect = \"none\";\n                    const thisDayIndex = dayCounter;\n                    dayDiv.dataset.dayIndex = thisDayIndex;\n                    dayDiv.addEventListener(\"click\", () =&gt; {\n                        const slider = Bokeh.documents[0].get_model_by_name(\"day_slider\
